import { React } from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect
} from "react-router-dom";
import Login from './component/Login'
import Application from './component/Application'
import './App.css';


function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Switch>
            <Route exact path="/">
              {/* {1===1 ? <Redirect to="/Login" /> : <h1>you have to login</h1>} */}
              <Redirect to="/login" />
            </Route>
            <Route  path="/application">
              <Application />
            </Route>

            <Route  path="/login">
              <Login />
            </Route>

          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
